import Layout from '../components/MyLayout';
import ShoppingList from '../components/ShoppingList';

export default function About() {
    return (
        <Layout>
            <ShoppingList>
                <a name = "Mark"> This is a shopping list </a>
            </ShoppingList>
        </Layout>
    );
}
